import React from 'react';

const Events = (props) => {
    const { title, description, img, postedDate, categories } = props
    return (
        <div className="card mb-3" style="max-width: 540px">
            <div className="row no-gutters">
                <div className="col-md-4">
                    <img className="card-img-left" src="http://placehold.it/300x400" alt="Card image cap" />
                </div>
                <div className="col-md-8">
                    <div className="card-body">
                        <h2 className="card-title">Tehapy Tanıtım</h2>
                        <p className="card-text">Tehapy projesinin sunumu</p>
                        <a href="#" className="btn btn-primary">Daha Fazla Oku... &rarr;</a>
                    </div>
                    <div className="card-footer text-muted">
                        25.11.2020 tarihinde
                <a href="#" className="font-blue"> Veli Adin </a> tarafından oluşturuldu
            </div>
                </div>
            </div>


        </div>
    );
};

export default Events;
